-- Table structure for sys_log
-- ----------------------------
DROP TABLE IF EXISTS `sys_log`;
CREATE TABLE `sys_log`
(
    `id`          bigint NOT NULL AUTO_INCREMENT COMMENT '主键',
    `passport`    varchar(128)  DEFAULT NULL COMMENT '账号',
    `url`         varchar(255)  DEFAULT NULL COMMENT '请求URL',
    `method`      varchar(255)  DEFAULT NULL COMMENT '请求方法',
    `params`      varchar(2048) DEFAULT NULL COMMENT '请求参数',
    `ip`          varchar(255)  DEFAULT NULL COMMENT '请求ip',
    `cost`        bigint        DEFAULT NULL COMMENT '请求耗时(单位毫秒)',
    `create_time` bigint NOT NULL COMMENT '创建时间',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  AUTO_INCREMENT = 1353
  DEFAULT CHARSET = utf8mb3 COMMENT ='系统日志';

-- ----------------------------
-- Records of sys_log
-- ----------------------------
BEGIN;
COMMIT;

SET FOREIGN_KEY_CHECKS = 1;
